  \"2015-01-09T16:58:47.841006\",\n\t\"name\": \"usgs-2011-national-landcover\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Land Cover Database products
  are created through a cooperative project conducted by the Multi-Resolution Land
  Characteristics (MRLC) Consortium. The MRLC Consortium is a partnership of federal
  agencies (www.mrlc.gov), consisting of the U.S. Geological Survey (USGS), the National
  Oceanic and Atmospheric Administration (NOAA), the U.S. Environmental Protection
  Agency (EPA), the U.S. Department of Agriculture (USDA), the U.S. Forest Service
  (USFS), the National Park Service (NPS), the U.S. Fish and Wildlife Service (FWS),
  the Bureau of Land Management (BLM) and the USDA Natural Resources Conservation
  Service (NRCS). The success of NLCD over nearly two decades is credited to the continuing
  collaborative spirit of the agencies that make up the MRLC. NLCD 2011 is the most
  up-to-date iteration of the National Land Cover Database, the definitive Landsat-based,
  30-meter resolution land cover database for the Nation. The data in NLCD 2011 are
  completely integrated with NLCD 2001 (2011 Edition) and NLCD 2006 (2011 Edition).
  For NLCD 2011, there are 5 primary data products: 1) NLCD 2011 Land Cover; 2) NLCD
  2006/2011 Land Cover Change Pixels labeled with the 2011 land cover class; 3) NLCD
  2011 Percent Developed Imperviousness; 4) NLCD 2006/2011 Percent Developed Imperviousness
  Change Pixels; and 5) NLCD 2011 Tree Canopy Cover provided by an MRLC partner -
  the U.S.D.A. Forest Service Remote Sensing Applications Center. In addition, ancillary
  metadata includes the NLCD 2011 Path/Row Index vector file showing the footprint
  of Landsat scenes and change analysis pairs used to derive 2006/2011 spectral change.
  All Landsat scene acquisition dates are included in the attribute table. Also, as
  part of the NLCD 2011 project, NLCD 2001 and 2006 land cover and impervious data
  products have been revised and reissued (2011 Edition) to provide full compatibility
  with the new NLCD 2011 products. NLCD Tree Canopy Cover was created using MRLC mapping
  zones from NLCD 2001 (see Tree Canopy Cover metadata for additional detail). All
  other NLCD 2011 products were created on a path/row basis and mosaicked to create
  a seamless national product. Questions about the NLCD 2011 land cover product can
  be directed to the NLCD 2011 land cover mapping team at the USGS/EROS, Sioux Falls,
  SD (605) 594-6151 or mrlc@usgs.gov.\",\n\t\"license_title\": null,\n\t\"extras\":
